import React from "react";
import "./MainPageComponent.css";
import logo from "../logo_transp.png";
import Avatar from "react-user-avatar";
import {
  BsBell,
  BsFillPersonFill,
  BsPersonCircle,
  BsChatFill,
  BsSearch,
} from "react-icons/bs";

class MainPageComponent extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      searchWord: "",
      firstName: "Axl",
      lastName: "Rose",
      username: firstname + " " + lastName,
    };
  }

  componentDidMount() {}

  render() {
    return (
      <div id="main_page_all">
        <div id="main_page_body">
          <nav>
            <div className="nav-left">
              <img src={logo} id="logo_nav" />

              <ul>
                <li>
                  <BsBell color="white" />{" "}
                </li>
                <li>
                  <BsPersonCircle color="white" />
                </li>
              </ul>
            </div>
            <div className="nav-right">
              <div className="search-box">
                <div className="search-box-img">
                  <BsSearch color="white" />
                </div>
                <input
                  type="text"
                  placeholder="Search for pings"
                  value="Search for pings"
                />
              </div>

              <div className="nav-user-icon">
                <div className="nav-user-icon-img online">
                  <Avatar size="50" name={this.state.username} />
                </div>
              </div>
            </div>
          </nav>

          <div className="main-page-container">
            <div className="left-sidebar"></div>
            <div className="main-content"></div>
            <div className="right-sidebar"></div>
          </div>
        </div>
      </div>
    );
  }
}

export default MainPageComponent;
